@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

:Message a owl:Class .
:displays a owl:ObjectProperty ;
    rdfs:domain :ATM ;
    rdfs:range :Message .
:instructs a owl:ObjectProperty ;
    rdfs:domain :Message ;
    rdfs:range :Customer .
:toCall a owl:ObjectProperty ;
    rdfs:domain :Message ;
    rdfs:range :Bank .
